function algoSelected(value){
    if(value == "AC3"){
        AC_3.init();
    }
}

var graph1;
var simulation = {
    play: false,
    pause: false,
    replay:false,
    zoom: 100,
    user_preferences: undefined,
    selected_node: undefined,
    selected_edge: undefined,
    add_node: false,
    add_edge: false,
    new_edge: { from: undefined, to: undefined }
};

window.onload = function(){
    main();
};

function main(){
    graph1 = new Graph("G1", "playground");

    // storing graphClick needed to remove event listener later
    var handler = function(e){ graph1.click(e); };
    this.graphClick = handler.bind(this);

    document.getElementById(graph1.graph_id).addEventListener('click', this.graphClick);

    if(!simulation.user_preferences){
        simulation.user_preferences = getUserPreferences();
    }
}

function play(){
    //document.getElementById(graph1.graph_id).removeEventListener('click', this.graphClick);
    simulation.play = true;
    simulation.pause = false;
    graph1.animate();
}

function pause(forcePause){
    var img = document.getElementById('btnPauseSimulation').childNodes[0];
    if(forcePause || img.src.includes("pause")){
        img.src = "icons/play.svg";
        simulation.play = false;
        simulation.pause = true;
        graph1.animate();
    }else{
        img.src = "icons/pause.svg";
        play();
    }
}

function replay(){
    var img = document.getElementById('btnPauseSimulation').childNodes[0];
    img.src = "icons/pause.svg";
    simulation.replay = true;
    simulation.play = false;
    simulation.pause = false;
    graph1.animate();
}

function zoom(){
    simulation.zoom += 10;
    var container = document.getElementById(graph1.graph_id);
    container.style.transform = "scale(" + simulation.zoom/100 + ")";
}

function zoomOut(){
    simulation.zoom -= 10;
    var container = document.getElementById(graph1.graph_id);
    container.style.transform = "scale(" + simulation.zoom/100 + ")";
}

function displayEditOptions(obj){
    if(document.getElementById("menuEdit").classList.contains("show")){
        obj.style.borderRadius = "0px";
        document.getElementById("menuEdit").classList.remove("show");
        document.getElementById("btnAddNode").classList.remove("show");
        document.getElementById("btnAddEdge").classList.remove("show");
        document.getElementById("deleteDialog").classList.remove("show");
    }else{
        obj.style.borderRadius = "0px";
        document.getElementById("menuEdit").classList.add("show");
        document.getElementById("btnAddNode").classList.add("show");
        document.getElementById("btnAddEdge").classList.add("show");
        document.getElementById("deleteDialog").classList.add("show");
    }
}

function addNode(){
    simulation.add_node = true;
    simulation.add_edge = false;
}

function addEdge(){
    simulation.add_edge = true;
    simulation.add_node = false;
}

function deleteGraph(obj){
    var dialog = obj.closest(".dialog");

    graph1.deleteGraph();

    if(dialog.querySelector('#cboRememberChoice').checked){
        simulation.user_preferences = { cboRememberChoice: true };
        storeUserPreferences(simulation.user_preferences);
    }

    closeDialog(obj);
}

function deleteNode(obj){
    graph1.deleteNode(simulation.selected_node);
    closeDialog(obj);
    obj.closest(".dialog").style.display = "none";
}

function nodeClick(id){
    simulation.selected_node = id;
}

function deleteEdge(obj){
    graph1.deleteEdge(simulation.selected_edge);
    closeDialog(obj)
}

function edgeClick(id){
    simulation.selected_edge = id;
}

function showDialog(obj){
    if(simulation.user_preferences && simulation.user_preferences.cboRememberChoice){
        obj.querySelector('#cboRememberChoice').checked = true;
        
        if(obj.parentElement.id != "deleteDialog"){
            obj.parentElement.classList.add('expand');
            obj.classList.add('expand');
            obj.querySelector('.x-touch').classList.add('expand');
        }else if(obj.parentElement.id == "deleteDialog"){
            graph1.deleteGraph();
        }
    }else{
        obj.parentElement.classList.add('expand');
        obj.classList.add('expand');
        obj.querySelector('.x-touch').classList.add('expand');
    }

    pause(true);
}

function closeDialog(obj){
    var dialog = obj.closest(".dialog");
    dialog.classList.remove('expand');
    dialog.querySelector('.content').classList.remove('expand');
    dialog.querySelector('.x-touch').classList.remove('expand');
    
    if(dialog.querySelector('#cboRememberChoice')){
        if(simulation.user_preferences && !simulation.user_preferences.cboRememberChoice){
            dialog.querySelector('#cboRememberChoice').checked = false;
        }
    }

    event.stopPropagation();
}

function storeUserPreferences(cvalue){
    var date = new Date();
    var expire_days = 30;
    date.setTime(date.getTime() + (expire_days * 24 * 60 * 60 * 1000));
    var expires = "expires=" + date.toUTCString();

    // create cookie
    document.cookie = "graph=" + JSON.stringify(cvalue) + ";expires=" + expires + ";path=/";
    console.log(document.cookie);
}

function getUserPreferences(){
    var name = "graph=";
    var ca = document.cookie.split(';');
    var cookie_value;

    for(var i = 0; i < ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0) == ' ') {
            c = c.substring(1);
        }
        if (c.indexOf(name) == 0) {
            // cookie found
            cookie_value =  c.substring(name.length, c.length);
            i = ca.length;
        }
    }

    if(cookie_value){
        return JSON.parse(cookie_value);
    }
}

